package com.diaspogift.identityandaccess.application.command;public class UnassignUsersFromRoleCommand {    private String tenantId;    private String username;    private String roleName;    public UnassignUsersFromRoleCommand(String tenantId, String username, String roleName) {        super();        this.tenantId = tenantId;        this.username = username;        this.roleName = roleName;    }    public UnassignUsersFromRoleCommand() {        super();    }    public String getTenantId() {        return this.tenantId;    }    public void setTenantId(String tenantId) {        this.tenantId = tenantId;    }    public String getUsername() {        return this.username;    }    public void setUsername(String username) {        this.username = username;    }    public String getRoleName() {        return this.roleName;    }    public void setRoleName(String roleName) {        this.roleName = roleName;    }}